import React from 'react';
import logo from './logo.svg';
import './App.css';
import Success from './comps_hw/success';
import Warning from './comps_hw/warning';
import Counter from './comps_hw/counter';
import Gallery from './comps_hw/gallery';
import CoounterState from './comps/counterState';

function App() {

  return (
    <div className="container">
      <Success/>
      <Warning/>
      <hr/>
      <Counter/>
      <Gallery/>
      <CoounterState/>

    </div>
  );
}

export default App;
